def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    parts = input1.split(' ')
    result = []
    for part in parts:
        sub_parts = part.split('-')
        transformed = ''.join(s.capitalize() if i > 0 else s for i, s in enumerate(sub_parts))
        result.append(transformed)
    return ' '.join(result)
